import React from 'react';
import {
	AppBar,
	Toolbar,
	Switch,
	Typography,
	makeStyles,
} from '@material-ui/core';

export default function Navbar() {
	return (
		<React.Fragment>
			<AppBar>
				<Toolbar>
					<Switch />
				</Toolbar>
			</AppBar>
			<Toolbar />
		</React.Fragment>
	);
}
